description:
Wolfblood is a BAFTA-nominated fantasy/supernatural British television series aimed at teens. The series focuses on teenage wolfbloods Maddy Smith (played by Aimee Kelly) and Rhydian Morris (played by Bobby Lockwood) as they struggle living their double lives as wolfbloods, and keeping their secret concealed from the outside world. The series, consisting of thirteen 30 minute episodes, premiered on CBBC from 10 September 2012.

